"use strict"

import { StyleSheet, View } from 'react-native';
import UploadButton from '../../components/general/_UploadButton';
import _UploadImagesGrid from '../../components/general/_UploadImagesGrid';

const Home = () => {
    return (
        <View>
            <UploadButton
            />
            <_UploadImagesGrid />
        </View>
    )
}
const styles = StyleSheet.create({
    container: {
        flex: 1,
        flexDirection: 'row',
        justifyContent: 'space-evenly',
        alignItems: 'center',
    }
})

export default Home;
